@andreika63 there is a repo full of examples of MyBatis with Kotlin here: https://github.com/jeffgbutler/mybatis-kotlin-examples

Also, MyBatis Generator will generate working Kotlin code.

I don't have anything in the repo that specifically uses lazy associations, but there are examples of overcoming some other common issues with Kotlin.

